import Stack from '@mui/material/Stack';
import Item from './Item';

export default function Home (){

    return (
        <div>
            <Stack spacing={2}>
                <Item>Item 1</Item>
                <Item>Item 2</Item>
                <Item>Item 3</Item>
            </Stack>
        </div>
    )

}
